import React, { useState } from 'react';
import { Button } from 'primereact/button';
import { Dropdown } from 'primereact/dropdown';

const FigmaMCPHeader = () => {
  const [selectedVariant, setSelectedVariant] = useState('Xxl Header + Buttons');

  const variants = [
    { label: 'Xxl Header + Buttons', value: 'Xxl Header + Buttons' },
    { label: 'Xl Header + Buttons', value: 'Xl Header + Buttons' },
    { label: 'Lg Header + Buttons', value: 'Lg Header + Buttons' }
  ];

  const getHeaderText = (variant) => {
    switch (variant) {
      case 'Xxl Header + Buttons':
        return 'Xxl Header';
      case 'Xl Header + Buttons':
        return 'Xl Header';
      case 'Lg Header + Buttons':
        return 'Lg Header';
      default:
        return 'Xxl Header';
    }
  };

  const getHeaderSize = (variant) => {
    switch (variant) {
      case 'Xxl Header + Buttons':
        return 'text-2xl'; // 24px
      case 'Xl Header + Buttons':
        return 'text-xl'; // 20px
      case 'Lg Header + Buttons':
        return 'text-lg'; // 18px
      default:
        return 'text-2xl';
    }
  };

  return (
    <div className="p-4">
      <div className="mb-4">
        <h2 className="text-2xl font-bold mb-2">Figma MCP Header Component</h2>
        <p className="text-gray-600 mb-4">
          This component was built using Figma MCP from your selected design.
        </p>

        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-700 mb-2">
            Select Header Variant:
          </label>
          <Dropdown
            value={selectedVariant}
            options={variants}
            onChange={(e) => setSelectedVariant(e.value)}
            placeholder="Select a variant"
            className="w-full md:w-20rem"
          />
        </div>
      </div>

      {/* Header Component */}
      <div className="bg-white border-b border-gray-300 relative">
        <div className="flex items-center justify-between px-6 py-4">
          {/* Left side - Header text */}
          <div className="flex items-center">
            <h1 className={`${getHeaderSize(selectedVariant)} font-normal text-gray-900 leading-tight`}>
              {getHeaderText(selectedVariant)}
            </h1>
          </div>

          {/* Right side - Buttons */}
          <div className="flex items-center gap-2">
            {/* Outline Button */}
            <Button
              outlined
              className="h-10 px-4 py-2 border-blue-600 text-blue-600 hover:bg-blue-50"
              style={{
                borderColor: '#0047BB',
                color: '#0047BB',
                fontSize: '14px',
                fontWeight: '700',
                fontFamily: 'Inter, sans-serif'
              }}
            >
              <i className="pi pi-check mr-2" style={{ fontSize: '14px' }}></i>
              Outline
            </Button>

            {/* Primary Button */}
            <Button
              className="h-10 px-4 py-2 bg-blue-600 border-blue-600 text-white hover:bg-blue-700"
              style={{
                backgroundColor: '#0047BB',
                borderColor: '#0047BB',
                fontSize: '14px',
                fontWeight: '700',
                fontFamily: 'Inter, sans-serif'
              }}
            >
              <i className="pi pi-check mr-2" style={{ fontSize: '14px' }}></i>
              Primary
            </Button>
          </div>
        </div>
      </div>

      {/* Component Info */}
      <div className="mt-6 p-4 bg-gray-50 rounded-lg">
        <h3 className="text-lg font-semibold mb-2">Component Details</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4 text-sm">
          <div>
            <strong>Current Variant:</strong> {selectedVariant}
          </div>
          <div>
            <strong>Header Size:</strong> {getHeaderSize(selectedVariant)}
          </div>
          <div>
            <strong>Primary Color:</strong> #0047BB
          </div>
          <div>
            <strong>Font Family:</strong> Inter
          </div>
        </div>
      </div>
    </div>
  );
};

export default FigmaMCPHeader;
